import './App.css';
import WalletBalance from "./Components/WalletBalanceSection/walletBalance";
import ButtonRow from "./Components/BittonsRowSection/ButtonsRow";

function App() {
  return (
    <div className="App">
      <header className="App-header">
          <div>
              <WalletBalance />
              <ButtonRow />
          </div>
      </header>
    </div>
  );
}

export default App;
